import React from 'react';
import Service from "../../repository/Repository";
import {useLocation} from "react-router-dom";

const SearchResult = ({ data }) => {
    const location=useLocation()
    const mydata=location.state
    const onFormSubmit =async (e) => {
        e.preventDefault();
        console.log(mydata)
    }
    return (
        <div style={{ display: "flex", flexDirection: "column", alignItems: "center" }}>
            <h1 style={{ fontSize: "32px", margin: "20px 0" }}>{mydata.searchname}</h1>
            <div style={{ display: "flex", justifyContent: "center", marginBottom: "20px" }}>
                <img src={mydata.thumbnail} alt={mydata.searchname} style={{ width: "50%" }} />
            </div>
            <p style={{ fontSize: "18px", textAlign: "center", maxWidth: "600px", margin: "0 20px" }}>{mydata.abstract}</p>
            <h2 style={{ fontSize: "24px", margin: "20px 0" }}>Books:</h2>
            <ul style={{ listStyle: "none", paddingLeft: 0 }}>
                {mydata.book.map((book) => (
                    <li key={book} style={{ fontSize: "18px", marginBottom: "10px" }}>{book}</li>
                ))}
            </ul>
        </div>
    );
};

export default SearchResult;
